import React from "react";

export default function MostPicked(props) {
  return (
    <section className="px-36 mb-[70px]">
      <h4 className="text-2xl mb-5">Most Picked</h4>
      <div className="grid grid-rows-2 grid-flow-col gap-7">
        {props.data?.map((item, index) => {
          return (
            <div
              className={
                index === 0 ? `min-h-[215px] row-span-2` : `min-h-[215px]`
              }
            >
              <div
                className="inline-flex items-center justify-center rounded-tr-2xl 
              rounded-bl-2xl bg-magenta text-white font-medium z-10 w-[180px] h-[40px] relative"
              >
                ${item.price}
                <span className="font-light text-white">per {item.unit}</span>
              </div>
              <div>
                <figure className="object-cover relative">
                  <img src={item.imageUrl} alt={item.name} width="100%"></img>
                </figure>
              </div>
            </div>
          );
        })}
      </div>
    </section>
  );
}
